import React from "react";
const Profile = () => {
    return (
      <div
        style={{
          height: '100vh',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center'
        }}
      >
        <h1>Profile</h1>
      </div>
    )
  }

  export default Profile;
